@font-face {
    font-family: newFont;
    src: url("7bae579607464e96e103f7d80c9ca680.ttf");
}

body {
    color:#1c4b82;
    background-color: #dae1e7;
    font-family: newFont;
}

h1 {
    font-size: 50px;
}

h2 {
   padding: 20px;
}


#top-nav {
    border-style: solid black;
    text-align: center;
}

.topnav {
    background-color: #022c43;
    overflow:hidden;
    text-align: center;
    font-size: 20px;
}

.topnav a{
    float: left;
    display: block;
    color: white;
    text-align: center; 
    padding: 14px 16px;
    text-decoration: none;
    font-size: 20px;
}

.active {
    color: white;
}

.topnav .icon {
    display:none;
}

.dropdown {
    float: left;
    overflow: hidden; 
}
.dropdown .dropbtn {
    font-size: 20px; 
    border: none;
    outline: none;
    color: white;
    background-color: inherit;
    font-family: inherit;
    margin: 0;
  }

  .dropdown-content {
    display: none;
    position: absolute;
    background-color: #115173;
    min-width: 160px;
    box-shadow: 0px 8px 16px 0px rgba(0,0,0,0.2);
    z-index: 1;
  }
  .dropdown-content a {
    float: none;
    color: black;
    padding: 12px 16px;
    text-decoration: none;
    display: block;
    text-align: left;
  }

  .topnav a:hover, .dropdown:hover .dropbtn {
    background-color: #053f5e;
    color: white;
  }
  .dropdown-content a:hover {
    background-color: #ddd;
    color: black;
  }

  .dropdown:hover .dropdown-content {
      display: block;
  }

  @media screen and (max-width:600px) {
      .topnav a:not(:first-child), .dropdown .dropbtn {
          display: none;
      }
      .topnav a.icon {
          float: right;
          display: block;
      }
  }

@media screen and (max-width: 600px){
    .topnav.responsive {position:relative;}
    .topnav.responsive a.icon {
        position: absolute;
        right: 0;
        top: 0;
    }

    .topnav.responsive a {
        float: none;
        display: block;
        text-align: left; 
    }

    .topnav.responsive .dropdown {float:none;}
    .topnav.resposive .dropdown-content {position:relative}
    .topnav.responsive .dropdown .dropbtn {
        display:block;
        width: 100%;
        text-align: left;
    }
}



#container {
    margin-left: auto;
    margin-right: auto;
    width: 1300px;
}

ul {
    display: block;
}

#icon-block {
    color:#ffd700;
    font-size: 50px;
    word-spacing: 200px;
}
.fa-home::before {
    color:#ffd700;
}
.fas{
    opacity: 0.7;
    color: #ffd700;
}

.fas:hover {
    opacity: 1;
}




.fab{
    opacity: 0.7;
    color: #ffd700;
}

.fab:hover {
    opacity: 1;
}
